/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `massspecinventory_addChemical` AFTER INSERT ON `massspec_inventory` FOR EACH ROW begin
	if (select count(*) from inventory.massspec_chemicals dc, inventory.chemicals c, inventory.massspec_inventory i where i.item = new.item and i.item = c.pk_inventory and dc.pk_chemical = c.pk_chemical) = 0 then
 		insert into inventory.massspec_chemicals (pk_chemical) select pk_chemical from inventory.chemicals where pk_inventory = new.item;
	END if; 
end */;;
